import './AllProduct.css';
import SingleProduct from "./SingleProduct";

function AllProduct(){
    const[isitem, setIsitem] = useState([]);

     useEffect(()=>{

        fetch("https://academics.newtonschool.co/api/v1/ecommerce/clothes/products",
        {
            method:"GET",
            headers:{
                projectId :"8spjkxc7tnxh",
                // AppType:"Soul Store",

            },

        }
        ).then((responce) => responce.json())
        .then((data) => 
        // console.log('data',data));
        setIsitem(data.data));
        // console.log('data', data);

     },[]);

    return(

      <div className ="container">
        {/* <h1>This is new Poroperty..!</h1> */}
            {/* <h1>Thiisitem.maps is all item</h1> 
            * { isitem  && isitem.map((post)=><SingleProduct item ={post} styele={{display:"grid", gridTemplateColumns: "repeat(3, 1fr)"}}/>,
               ` <div className="row col-sm-3">
               <div class="card-head">
                 <span className="item-img" key=${item.id}>
                   <img src=${item.displayImage} alt="item-image"/>
                 </span>
               </div>
             </div>`
            )} */}
       
          <div className="card-container">
            {isitem && isitem.map((product , index)=>(
              < SingleProduct key={index} item={product}  productImage ={product.displayImage}/>
            ))}
          </div>

        </div>

    );
}

export default AllProduct;
